    const theparent = parent || document.body 
    const theshapes = shapes || ['donut', 'cross', 'slice']
    const theshapes2 = shapes || ['Outline1','Outline2','Outline3','Outline4','Outline5','Outline6',]
    const burst = new mojs.Burst({
        parent: theparent,
        radius: { 20: 200 },
        count: 9,
        duration: 600,
        children: {
            shape: theshapes,
            fill: ['transparent'],
            radius: {20:200},
            delay: 'stagger( rand(0, 100) )',
        }
    })
    const burst2 = new mojs.Burst({
        parent: theparent,
        radius: { 20: 200 },
        count: 6,
        duration: 1000,
        children: {
            shape: theshapes2,
            fill: ['transparent'],
            radius: {20:200},
            delay: 'stagger( rand(0, 200) )',
        }
    })
    burst.el.style.zIndex = 1;
    burst2.el.style.zIndex = 1;

    const circle = new mojs.Shape({
      parent: theparent,
      fill:     '#00A8E2',
      radius:   {20:500},
      opacity: {1 : 0},
      duration:  1000,
    });

        const raterandom = (Math.random()*0.5)+0.5
        
